import Navbar from '../components/navbar/Navbar';
import WBK from 'wikibase-sdk';

export default function Tornados() {

    const wbk = WBK({ instance: 'http://156.35.98.107:8080' })
    const headers = { 'Accept': 'application/json' };
    var url = wbk.getEntities('Q23')

    fetch(url, { headers }).then(body => { body.json().then(data => { console.log(data.entities) }); });

    var tornados = [{ title: '2021', state: 'Ohio' }, { title: '2022', state: 'Texas' }];

    var tornadoHTML = tornados.map(function (tornado) {
        return (
            <tr>
                <td>{tornado.title}</td>
                <td>{tornado.state}</td>
            </tr>
        )
    })

    return (
        <div>
            <Navbar page="Tornados" />
            <div className='container col-md-8'>
                <table class="table table-dark">
                    <thead>
                        <tr>
                            <th scope="col">Nombre</th>
                            <th scope="col">Estado</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            tornadoHTML()
                        }
                    </tbody>
                </table>
            </div>
        </div>

    )
}
